-- ----------------------------
--  Table structure for `buss_delivery_station`
-- ----------------------------
DROP TABLE IF EXISTS `buss_delivery_station`;
CREATE TABLE `buss_delivery_station` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `regionalism_id` int(11) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `address` varchar(255) DEFAULT NULL,
  `remarks` varchar(255) DEFAULT NULL,
  `created_by` int(255) DEFAULT NULL,
  `created_time` datetime DEFAULT NULL,
  `updated_by` int(11) DEFAULT NULL,
  `updated_time` datetime DEFAULT NULL,
  `del_flag` tinyint(1) DEFAULT '1',
  `capacity` varchar(255) DEFAULT NULL COMMENT '产能  多少 个/天',
  `deadline` varchar(255) DEFAULT NULL COMMENT '截止接单时间',
  `coords` text COMMENT '配送的范围坐标列表',
  `position` varchar(255) DEFAULT NULL COMMENT '位置',
  `phone` varchar(255) DEFAULT NULL COMMENT '联系电话',
  `is_national` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0：非全国    1：全国',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=56 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='配送站';

