-- ----------------------------
--  Table structure for `buss_order`
-- ----------------------------
DROP TABLE IF EXISTS `buss_order`;
CREATE TABLE `buss_order` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '订单号',
  `recipient_id` int(11) NOT NULL COMMENT '收货人id',
  `delivery_id` int(11) NOT NULL COMMENT '配送站id',
  `src_id` int(11) unsigned NOT NULL COMMENT '订单来源id',
  `shop_id` int(10) unsigned DEFAULT NULL COMMENT '如果delivery_type为''TAKETHEIR'' 时为门店ID，否则为空',
  `pay_modes_id` int(10) unsigned DEFAULT NULL,
  `owner_name` varchar(255) DEFAULT NULL COMMENT '下单人姓名',
  `owner_mobile` varchar(20) CHARACTER SET utf8 DEFAULT NULL COMMENT '下单人手机',
  `status` enum  ('CANCEL','UNTREATED','TREATED','STATION','CONVERT','INLINE','DELIVERY','COMPLETED','EXCEPTION') NOT NULL DEFAULT 'UNTREATED' COMMENT '取消，未处理，分配配送站，已转换，生产中，配送员配送中，已完成，异常',
  `pay_status` enum  ('COD','REFUNDING','REFUNDED','PAYED','PARTPAYED') NOT NULL DEFAULT 'PAYED' COMMENT '货到付款，退款中，已退款，已付款,部分付款',
  `is_submit` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否提交（0：false，1：true）',
  `is_deal` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否处理（0：false，1：true）',
  `delivery_time` varchar(25) CHARACTER SET utf8 DEFAULT NULL,
  `cancel_reason` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '取消理由',
  `remarks` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '备注',
  `invoice` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '发票的相关信息',
  `total_amount` int(10) unsigned DEFAULT NULL COMMENT '应收金额',
  `total_original_price` int(10) unsigned DEFAULT NULL COMMENT '该订单所有商品原价',
  `total_discount_price` int(10) unsigned DEFAULT NULL COMMENT '该订单所有商品实际售价',
  `created_by` varchar(255) CHARACTER SET utf8 NOT NULL COMMENT '创建人',
  `created_time` datetime NOT NULL COMMENT '创建时间',
  `updated_by` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '记录更新操作者',
  `updated_time` datetime DEFAULT NULL COMMENT '记录更新时间',
  `del_flag` tinyint(1) NOT NULL DEFAULT '1' COMMENT '软删除标志',
  `merchant_id` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT '商户订单',
  `coupon` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT '团购券号',
  `print_status` enum  ('PRINTABLE','UNPRINTABLE','AUDITING','REPRINTABLE') DEFAULT 'PRINTABLE' COMMENT '可打印，不可打印，审核中，可重打印',
  `COD_amount` int(10) unsigned DEFAULT NULL COMMENT '未签收时货到付款实收',
  `unsignin_reason` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '未签收理由',
  `late_minutes` int(10) unsigned DEFAULT NULL COMMENT '迟到分钟数',
  `payfor_amount` int(11) DEFAULT NULL COMMENT '赔偿金额',
  `payfor_reason` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '赔偿原因',
  `payfor_type` enum  ('CASH','FULL_REFUND') DEFAULT NULL COMMENT '赔偿方式',
  `signin_time` datetime DEFAULT NULL COMMENT '签收时间',
  `submit_time` datetime DEFAULT NULL COMMENT '客服操作人员点击“提交”按钮时间',
  `deliveryman_id` int(10) unsigned DEFAULT NULL COMMENT '配送员ID',
  `exchange_time` datetime DEFAULT NULL COMMENT '订单转换时间',
  `print_time` datetime DEFAULT NULL COMMENT '订单打印时间',
  `greeting_card` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '所有的祝福贺卡集合',
  `office_id` int(11) DEFAULT NULL,
  `last_opt_cs` int(10) unsigned DEFAULT NULL COMMENT '最后操作客服人员',
  PRIMARY KEY (`id`),
  UNIQUE KEY `IDX_UNQ_MID` (`merchant_id`),
  KEY `IDX_STATUS` (`status`),
  KEY `IDX_OWNER_MOBILE` (`owner_mobile`),
  KEY `IDX_DELIVERY_TIME` (`delivery_time`) COMMENT '配送时间Btree索引',
  KEY `IDX_CREATED_TIME` (`created_time`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=10000001 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='订单详情表';

-- ----------------------------
--  Table structure for `buss_order_error`
-- ----------------------------
DROP TABLE IF EXISTS `buss_order_error`;
CREATE TABLE `buss_order_error` (
  `merchant_id` varchar(50) NOT NULL COMMENT '外部订单编号',
  `src_id` int(11) NOT NULL COMMENT '订单来源ID',
  `type` enum  ('GENERAL','SYSTEM_ERROR','NOTIFY_MANAGER') DEFAULT 'GENERAL' COMMENT '错误类型：一般，系统错误，通知经理',
  `detail` text NOT NULL COMMENT '详细错误信息',
  `status` enum  ('OPEN','CLOSE') DEFAULT 'OPEN' COMMENT '处理状态：等待处理，已处理',
  `created_by` int(10) unsigned NOT NULL DEFAULT '0',
  `created_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_by` int(10) unsigned NOT NULL DEFAULT '0',
  `updated_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`merchant_id`,`src_id`),
  KEY `IDX_MERCHANT_ID` (`merchant_id`),
  KEY `IDX_CREATED_TIME` (`created_time`),
  KEY `IDX_TYPE` (`type`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='系统-错误订单';

-- ----------------------------
--  Table structure for `buss_order_fulltext`
-- ----------------------------
DROP TABLE IF EXISTS `buss_order_fulltext`;
CREATE TABLE `buss_order_fulltext` (
  `order_id` int(10) unsigned NOT NULL,
  `merchant_id` varchar(50) DEFAULT NULL COMMENT '外部订单ID',
  `owner_name` varchar(255) DEFAULT NULL,
  `owner_mobile` varchar(40) DEFAULT NULL,
  `recipient_name` varchar(255) DEFAULT NULL,
  `recipient_mobile` varchar(40) DEFAULT NULL,
  `recipient_address` text,
  `landmark` varchar(255) DEFAULT NULL,
  `show_order_id` varchar(16) DEFAULT NULL,
  `del_flag` tinyint(1) DEFAULT '1',
  `deliveryman_name` varchar(50) DEFAULT NULL COMMENT '配送员名字',
  `deliveryman_mobile` varchar(11) DEFAULT NULL COMMENT '配送员电话',
  PRIMARY KEY (`order_id`),
  FULLTEXT KEY `IDX_FL` (`owner_name`,`owner_mobile`,`recipient_name`,`recipient_mobile`,`recipient_address`,`landmark`,`show_order_id`,`merchant_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='供订单全文搜索';

