-- ----------------------------
--  Table structure for `buss_order_sku`
-- ----------------------------
DROP TABLE IF EXISTS `buss_order_sku`;
CREATE TABLE `buss_order_sku` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` int(10) unsigned NOT NULL,
  `sku_id` int(10) unsigned NOT NULL COMMENT '产品ID',
  `num` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '产品数量',
  `choco_board` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '巧克力牌上文字内容',
  `greeting_card` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '祝福贺卡上的问题内容',
  `atlas` tinyint(1) DEFAULT NULL COMMENT '是否需要产品图册（0：false；1：true）',
  `custom_name` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '自定义名称',
  `custom_desc` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '自定义描述',
