  `del_flag` tinyint(1) DEFAULT '1' COMMENT '删除标志',
  PRIMARY KEY (`id`),
  KEY `IDX_ORDERID` (`order_id`),
  KEY `IDX_QUERY` (`status`,`created_time`)
